import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarFiveColsStyle = styled(motion.div)`
  position: absolute;
  right: 1vw;
  width: 800px;
  background-color: #f2c14e;
  height: auto;
  padding: 20px;
  cursor: auto;
  display: flex;
  justify-content: space-between;
  .section {
    display: flex;
    flex-direction: column;
    height: 350px;
    width: 150px;
    * {
      cursor: auto;
    }
    .cover {
      position: absolute;
      background-color: ivory;
      height: 100px;
      width: 150px;
    }
    .title {
      color: #f8f8ff;
      margin-top: 120px;
    }
    span {
      color: #8a8888;
    }
  }
`;

const NavbarFiveCols = ({ controller }) => {
  return (
    <NavbarFiveColsStyle animate={controller}>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      " App Name Tresom Hatity Otcom Daltfresh Duobam Mat Lam Tam "
      <div className="section">
        <div className="cover" />
        <span className="title"> App Name </span>
        <span></span>
        <span>Hatity</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
    </NavbarFiveColsStyle>
  );
};

export default NavbarFiveCols;
